import logo from './logo.svg';
import 'boxicons';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <i className="bx bx-hot"></i>
        <i className="bx bxs-hot"></i>
        <i className="bx bxl-facebook-square"></i>
      </header>
    </div>
  );
}

export default App;
